pragma solidity ^0.8.4;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract AurusX_Staking is Ownable {
    using SafeMath for uint256;

    /**
     * @dev Emitted when stake action is processed
     */
    event Stake(address owner, uint256 amount);

    /**
     * @dev Emitted when unstake action is processed
     */
    event Unstake(address owner, uint256 amount, uint256 period, uint256 payoutId);

    /**
     * @dev Emitted when a payout is executed and tokens are sent to the owner
     */
    event PayoutExecuted(uint256 _payoutId, address receiver, uint256 amount);

    struct Payout {
        address owner;
        uint256 amount;
        bool active;
        uint256 unlockTimestamp;
    }

    uint256 public minStake = 0;
    uint256 public maxStake = type(uint256).max;
    uint256 public unlockWaitingTime = 30 days;
    bool public stakingOpen = false;
    IERC20 public tokenContract;

    mapping (address => uint256) public stakes;
    Payout[] public payouts;

    /**
    * @dev - Set staking parameters. Owner only
    */
    function setParameters(uint256 _minStake, uint256 _maxStake, uint256 _unlockWaitingTime, bool _stakingOpen, address _tokenContractAddress) external onlyOwner {
        minStake = _minStake;
        maxStake = _maxStake;
        unlockWaitingTime = _unlockWaitingTime;
        stakingOpen = _stakingOpen;
        tokenContract = IERC20(_tokenContractAddress);
    }

    /**
    * @dev - Stake tokens and receive tokens
    */
    function stakeTokens(uint256 _amount) external {
        require (_amount > 0 && _amount >= minStake && _amount <= maxStake, "Invalid stake amount");
        require(tokenContract.allowance(msg.sender, address(this)) >= _amount, "Allowance is too small");
        require(tokenContract.transferFrom(msg.sender, address(this), _amount), "Transfer to staking contract failed");

        stakes[msg.sender] = stakes[msg.sender].add(_amount);
        emit Stake(msg.sender, _amount);
    }

    /**
    * @dev - Unstake tokens and create payout
    */
    function unstakeTokens(uint256 _amount) external returns (uint256 _payoutId){
        require (_amount > 0 && _amount <= stakes[msg.sender], "Invalid amount");
        uint256 _releaseDate = block.timestamp.add(unlockWaitingTime);

        _payoutId = payouts.length;
        Payout memory _payout = Payout(
            msg.sender,
            _amount,
            true,
            _releaseDate
        );        
        payouts.push(_payout);        

        stakes[msg.sender] = stakes[msg.sender].sub(_amount);
        emit Unstake(msg.sender, _amount, _releaseDate, _payoutId);
        return _payoutId;
    }

    /**
    * @dev - Can be called by any address to process a list of payout ids
    */
    function executePayouts(uint256[] calldata _payoutIds) external {
        for (uint i=0; i<_payoutIds.length; i++) {
            uint256 payoutId = _payoutIds[i];
            Payout memory _payout = payouts[payoutId];
            if (_payout.active && block.timestamp >= _payout.unlockTimestamp) {                
                _payout.active = false;
                payouts[payoutId] = _payout;
                tokenContract.transfer(_payout.owner, _payout.amount);
                emit PayoutExecuted(payoutId, _payout.owner, _payout.amount);
            }
        }
    }
}
